package com.kasite.client.order.bean.dbo;import java.sql.Timestamp;import javax.persistence.Id;import javax.persistence.Table;import tk.mybatis.mapper.annotation.KeySql;@Table(name="O_ORDER_SUB")public class OrderSub { 		@Id	@KeySql(useGeneratedKeys=true)	private Long id;	 	private String orderId;  	private String subHisOrderId; 	 	private Integer price; 	 	private String priceName; 	 	private Timestamp createTime; 	 	private Timestamp updateTime; 	 	private String hisRegId; 		public String getHisRegId() {		return hisRegId;	}	public void setHisRegId(String hisRegId) {		this.hisRegId = hisRegId;	}	public Long getId() {		return id;	}	public void setId(Long id) {		this.id = id;	}	public String getOrderId() {		return orderId;	}	public void setOrderId(String orderId) {		this.orderId = orderId;	}	public String getSubHisOrderId() {		return subHisOrderId;	}	public void setSubHisOrderId(String subHisOrderId) {		this.subHisOrderId = subHisOrderId;	}	public Integer getPrice() {		return price;	}	public void setPrice(Integer price) {		this.price = price;	}	public String getPriceName() {		return priceName;	}	public void setPriceName(String priceName) {		this.priceName = priceName;	}	public Timestamp getCreateTime() {		return createTime;	}	public void setCreateTime(Timestamp createTime) {		this.createTime = createTime;	}	public Timestamp getUpdateTime() {		return updateTime;	}	public void setUpdateTime(Timestamp updateTime) {		this.updateTime = updateTime;	}}